    <div className="flex bg-[#EDEDDD] flex-col ">
      <div className=" flex flex-col items-start space-y-20 mx-32">
        <div className="w-[177px] h-[53.52px]  pt-4">
          <img src={logo} alt="Logo" className="w-full h-full object-contain" />
        </div>
        <div className="flex flex-col space-y-2">
          <div className=" ml-7">
            <p className=" text-[68px]">Making Trade Documents Digital</p>
          </div>
          <div className=" ml-7">
            <p className=" text-[24px]">
              Secure and streamline your trade document management with our
              platform â€” where top-tier security meets efficiency for a
              sustainable business future.
            </p>
          </div>
          <button className=" w-[156px] h-[48px] rounded-md bg-[#0F7350] text-white">
            Let's Start
          </button>
        </div>
      </div>
    </div>
  );
};

export default Header;
